$("button").click(function() {
    let color=$(".colorInput").val();
    console.log(color);
    let height=$(".heightInput").val();
    if (color==="yellow"&&height>=5) {
        $("h2").append("Electivire");
        $("h2").append(`<img src="data:image/jpeg;base64,"/>`);
    }
    else if(color==="yellow"&&height<5&&height>0){
        $("h2").append("Pikachu");
        $("h2").append(`<img src="https://assets.pokemon.com/assets/cms2/img/pokedex/full/025.png"/>`);
    }
    else if(color==="white"&&height>=5){
        $("h2").append("Snorlax");
        $("h2").append(`<img src="data:image/jpeg;base64,"/>`);
    }
    else if(color==="white"&&height<5&&height>0){
        $("h2").append("Eevee");
        $("h2").append(`<img src="data:image/jpeg;base64,"/>`);
    }
    else{
    $("h2").append("No Data, Still developing Pokedex");
    $("h2").append(`<img src="data:image/jpeg;base64,"/>`);
    }
});